import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import './App.css';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleLogin = (e) => {
    e.preventDefault();

    if (email && password) {
      alert('Login successful!');
      // Redirect to main dashboard
      navigate('/dashboard');
    } else {
      alert('Please fill all fields');
    }
  };

  return (
    <div className="login-container">
      <div className="login-form">
        <h2>Login</h2>
        <form onSubmit={handleLogin}>
          <div className="form-group">
            <label>Email:</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          <div className="form-group">
            <label>Password:</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>
          <button type="submit">Login</button>
        </form>
        <p>Need an account? <a href="#">Register</a></p>
      </div>
    </div>
  );
}

function Dashboard() {
  return (
    <div className="dashboard">
      <h1>Excel Data Analysis Dashboard</h1>

      <div className="upload-section">
        <h2>Upload Excel File</h2>
        <input type="file" accept=".xlsx,.xls" />
        <button>Upload & Analyze</button>
      </div>

      <div className="features">
        <div className="feature-card">
          <h3>üìä 2D Charts</h3>
          <p>Bar, Line, Pie, Scatter charts</p>
        </div>
        <div className="feature-card">
          <h3>üìà 3D Charts</h3>
          <p>3D column and surface charts</p>
        </div>
        <div className="feature-card">
          <h3>üìÅ Upload History</h3>
          <p>View your previous analyses</p>
        </div>
        <div className="feature-card">
          <h3>ü§ñ AI Insights</h3>
          <p>Smart data summaries</p>
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
